import React from "react"

const RenderObj = (props) => {
    return (
        Object.keys(props.details).forEach(priKey => {
            if (!Number.isInteger(parseInt(priKey, 10))) {
                console.log(`key: ${priKey}, value: ${props.details[priKey]}`)
                return (
                    <div>
                        {props.details[priKey]}
                    </div>
                )

            }
        }
        )
    )
}

function ManageDetailsView(props) {

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>&nbsp;</th>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Category</th>
                    </tr>
                </thead>
                <tbody>
                    <tr key="1">
                        {

                        }
                    </tr>
                </tbody>
            </table>
            <div>
                {
                    Object.keys(props.details).forEach(priKey => {
                        if (!Number.isInteger(parseInt(priKey, 10))) {
                            console.log(`key: ${priKey}, value: ${props.details[priKey]}`)
                            return (
                                <div>
                                    {props.details[priKey]}
                                </div>
                            )

                        }
                    }
                    )
                }
            </div>
        </div>
    )
}

export default RenderObj;

